// TODO eliminare
#include "../GTB.h"
#include "../../util/Singleton.h"

class KPK: public Singleton<KPK> {
    friend class Singleton<KPK>;

private:
    u64 kpkBitbase[2][64][64];
public:
    void init() {
        memset(kpkBitbase, 0, sizeof(kpkBitbase));
        cout << "{{\n";
        TODOpopulate(BLACK);
        cout << "},{\n";
        TODOpopulate(WHITE);
        cout << "}}\n";
    }

    void TODOpopulate(const int side) {
        _Tchessboard chessboard;
        memset(chessboard, 0, sizeof(_Tchessboard));
        GTB &gtb = GTB::getInstance();
        gtb.setPath("/gtb4");
        for (int kw = 0; kw < 64; kw++)
            for (int kb = 0; kb < 64; kb++)
                for (int p = 0; p < 64; p++) {
                    if (kw == kb || kw == p || kb == p)continue;
                    chessboard[KING_WHITE] = POW2[kw];
                    chessboard[KING_BLACK] = POW2[kb];
                    chessboard[PAWN_BLACK + side] = POW2[p];
//                    if (kw == 23 && kb == 43 && p == 37)
//                       cout <<"TODOOOOOO";
                    const auto res = gtb.getDtm(side, false, chessboard, 0, 100);
                    if (res > 0 && abs(res) != INT_MAX) {
                        kpkBitbase[side][kw][kb] |= POW2[p];
                    } else _assert(!(kpkBitbase[side][kw][kb] & POW2[p]));
                }

        for (int i = 0; i < 64; i++) {
            cout << endl;
            cout << "{";
            for (int j = 0; j < 64; j++)
                cout << "0x" << hex << kpkBitbase[side][i][j] << "ULL,";
            cout << "},";
        }

    }

};

